import React, { Component } from 'react';
import { Input} from 'antd'
const { TextArea } = Input;

class Dashboard extends Component {
    constructor(props) {
        super(props);
    }
    handleCut = (event) => {
        event.preventDefault();
    }
    handleCopy = (event) => {
        event.preventDefault()
    }
    handlePaste = (event) => {
        event.preventDefault();
    }
    handleDrag = (event) => {
        event.preventDefault();
    }
    handleDrop = (event) => {
        event.preventDefault();
    }
    render() {
        return (
            <div className="dashboard-container">
                <div className="appbar">
                    <div className="logo-div">
                        <img id="logo" src={require('../assets/BridgeLabz New Logo.svg')} />
                        <span className="title">online-ide</span>
                    </div>
                </div>
                <div className="text-area-div">
                    <TextArea id='text' onPaste={(event) => this.handlePaste(event)} onCopy={(event) => this.handleCopy(event)}
                        onCut={(event) => this.handleCut(event)} onDrag={(event) => this.handleDrag(event)} onDrop={(event) => this.handleDrop(event)} autoComplete='off'>
                    </TextArea>
                </div>
            </div>

        )
    }
}

export default Dashboard
